function ShopItem(props) {

    const { itemName, itemPic, clickFunction } = props;
    return (
        <div id={itemName}>
            <img src={itemPic} alt={itemName}></img>
            <h4></h4>
            <button onClick={clickFunction} className='item-button'></button>

        </div>
    )
}

export default ShopItem;
